import React from 'react'
import './styles/Welcome.css'

const Welcome = ({userName}) => (
    <div className="container">
            <div className="Fitness-User-Info">
                <h1>Hello {userName}!</h1>
                <p>Let's workout to get some gains!</p>
            </div>
        </div>
)
